import ArticlesList from './ArticlesList';

const ArticlesByAuthor = () => {
  return (
    <div>
      <h2> All Articles By {this.props.authorName} </h2>
        <ArticlesList authorName={this.props.authorName}/>
    </div>
  );
};

export default ArticlesByAuthor;
